import React, { useState, useEffect } from 'react';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import Portfolio from '../projectCards';
import LaunchIcon from '@material-ui/icons/Launch';
import CodeIcon from '@material-ui/icons/Code';
import SkillsGrid from '../components/SkillsGrid/index';
import NavBar from '../components/AppBar/index';
import ContactForm from '../components/ContactForm/index'

function Copyright() {
    return (
        <Typography variant="body2" color="textSecondary" align="center">
            {'Copyright Â© '}
            <Link color="inherit" href="https://material-ui.com/">
                Zachary Nylen
      </Link>{' '}
            {new Date().getFullYear()}
            {'.'}
        </Typography>
    );
}

const useStyles = makeStyles(theme => ({
    icon: {
        marginRight: theme.spacing(2),
    },
    heroContent: {
        backgroundColor: theme.palette.background.paper,
        padding: theme.spacing(8, 0, 6),
    },
    heroButtons: {
        marginTop: theme.spacing(4),
    },
    cardGrid: {
        paddingTop: theme.spacing(8),
        paddingBottom: theme.spacing(8),
    },
    card: {
        height: '100%',
        display: 'flex',
        flexDirection: 'column',
    },
    cardMedia: {
        paddingTop: '56.25%', // 16:9
    },
    cardContent: {
        flexGrow: 1,
    },
    footer: {
        backgroundColor: theme.palette.background.paper,
        padding: theme.spacing(6),
    },
}));

export default function Contact() {
    const classes = useStyles();

    const [projects, setProjects] = useState(Portfolio)

    return (
        <React.Fragment>
            <CssBaseline />
            <NavBar />
            <main style={{ backgroundColor: "#f7f7f7", height: "500px" }}>
                {/* Hero unit */}
                <Container style={{ width: "80%", textAlign: "center", backgroundColor: "blue" }}>
                <Card style={{ width: "90%", marginTop: "50px", marginBottom: "20px", display: "inline-block" }}>
                    <div style={{ margin: "20px" }}>
                    <ContactForm/>
                    </div>
                </Card>
                </Container>
            </main>
            {/* Footer */}
            <footer className={classes.footer} style={{ backgroundColor: "#00695D" }}>
                <Typography style={{ color: "white" }} variant="subtitle1" align="center" component="p">
                    "It's not that we use technology, we live technology." - Godfrey Reggio
        </Typography>
                <br></br>
                <Copyright />
            </footer>
            {/* End footer */}
        </React.Fragment>
    );
}
